import * as React from 'react';
import { Button, Image, View, Text, TouchableOpacity, ScrollView, StyleSheet} from 'react-native';

export default class HomeScreen extends React.Component {
	render(){
		return(
            <ScrollView>
                <View style={styles.container}>
                    <Image
                        style = {styles.Aily_Logo}
                        source = {require('../assets/10.png')}
                    />

                    <TouchableOpacity
                        marginTop = {50}
                        marginBottom = {50}
                        title = "Log In"
                        onPress={() => this.props.navigation.navigate("Login")}
                    >

                    </TouchableOpacity>
                    
                    <TouchableOpacity
                        style={styles.Sign_Up_Button}
                        onPress={() => this.props.navigation.navigate("SignUp")}
                    >
                        <Text style = {{color: "#FFF", fontWeight: "600"}}> Sign Up </Text>
                    </TouchableOpacity>
                
                </View>  
            </ScrollView>
		)
	}
}

const styles = StyleSheet.create({
    container: {
        flex : 1,
        alignItems: 'center',
        justifyContent: 'center',
        backgroundColor: '#fff',
    },
    
    Aily_Logo: {
        width: 206,
        height: 104,
        marginTop: 50,
        marginBottom: 50,
    },
    
    Log_In_Button: {
        marginTop: 50,
        marginBottom: 50,
    },
    Sign_Up_Button: {
        marginHorizontal: 0,
        backgroundColor : '#000080',
        borderRadius : 4,
        height: 52,
        width : 300,
        marginTop: 50,
        marginBottom: 10,
        alignItems: 'center',
        justifyContent: 'center'
    }
    
});
